/**
 * Adminimize script to select all checkbox for each rows.
 * Only load and usage on settings page.
 *
 * @version 2015-12-16
 */
jQuery(document).ready(function(c){"use strict";c("thead input:checkbox").change(function(){var e=this.className,t="input:checkbox."+e;c(t).prop("checked",c(this).prop("checked"))})});